import React from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { robots } from './robots';
import './App.css';

const App = () => {
    return (
        <div>
            <h1 className="test">RoboFriends</h1>
            <SearchBox className="test"/>
            <CardList robots={robots} />
        </div>
    )
}

export default App;
